INSERT INTO `Command` (`pk`, `commandUsage`, `commandType`, `verificationCommand`, `command`, `outputLocation`, `eventDetailCommand`, `description`, `supportedBy`, `outputFileFormat`, `replaces`, `lastModified`, `enabled`) VALUES ('64c450b4-135c-46d1-a9aa-3f9b15671677','command','a5fa09c6-9a8d-40b9-aee2-2641160f969e','a9111dc0-edc9-47f8-85e5-ad4013971361','sudo /usr/bin/inkscape \"%fileFullName%\" --export-plain-svg=\"%outputDirectory%%prefix%%fileName%%postfix%.svg\"\n sudo chmod 777 \"%outputDirectory%%prefix%%fileName%%postfix%.svg\"','%outputDirectory%%prefix%%fileName%%postfix%.svg','1db2deea-01dd-43e5-9f27-dc9ed02acdfe','Transcoding to plain svg with inkscape','ca278b07-8137-4a75-b84f-9b10994ed006','Scalable Vector Graphics',NULL,'2012-10-02 03:24:59',1);
INSERT INTO `Command` (`pk`, `commandUsage`, `commandType`, `verificationCommand`, `command`, `outputLocation`, `eventDetailCommand`, `description`, `supportedBy`, `outputFileFormat`, `replaces`, `lastModified`, `enabled`) VALUES ('665e6bf4-0c6d-432a-a0c6-04050e1cfae5','command','a5fa09c6-9a8d-40b9-aee2-2641160f969e',NULL,'exitCode=0\nfilesFound=0\nfunction checkDirectory {\n cd \"$1\"\n for f in *; do \n if [ -d \"$f\" ] ; then\n checkDirectory \"$f\" || exitCode=1\n else\n if [ -s \"$f\" ]; then\n filesFound=1\n else\n echo \"0 byte file: $f\"\n exitCode=2\n fi\n fi\n done\n}\n\ncheckDirectory \"%outputLocation%\"\nif [ $filesFound -eq 0 ] ; then\n exit 3\nelse\n exit $exitCode\nfi','',NULL,'Standard directory verification command','ca278b07-8137-4a75-b84f-9b10994ed006','',NULL,'2012-10-02 03:24:59',1);
INSERT INTO `Command` (`pk`, `commandUsage`, `commandType`, `verificationCommand`, `command`, `outputLocation`, `eventDetailCommand`, `description`, `supportedBy`, `outputFileFormat`, `replaces`, `lastModified`, `enabled`) VALUES ('67432cf4-fd33-4943-a1e7-4b4a8c27bb1d','verification','ee6869f7-3ac0-44ed-a5ca-50f0f81cd7c1',NULL,'#!/usr/bin/python\n#\n\nimport os\ndirectory = \"%outputLocation%\"\nextension = \".mbox\"\n\ndef appendExtensionToFilesWithNoExtension(directory, extension, baseDirectory=\"\"):\n for dirname, dirnames, filenames in os.walk(directory):\n for filename in filenames:\n if filename.rfind(\".\") == -1:\n newName = os.path.join(os.path.dirname(filename), \"0-\" + os.path.basename(filename)) + extension\n n=1\n while os.path.exists(os.path.join(dirname, newName)):\n newName = os.path.join(os.path.dirname(filename), \"0-\" + os.path.basename(filename)) + n.__str__() + extension\n n+=1\n print \"Renaming: \", filename, \" -> \" + newName\n os.rename(os.path.join(dirname, filename), os.path.join(dirname, newName))\n\nappendExtensionToFilesWithNoExtension(directory, extension, baseDirectory=directory)\n','',NULL,'append .mbox extension to files without extensions','ca278b07-8137-4a75-b84f-9b10994ed006','',NULL,'2012-10-02 03:24:59',1);
