INSERT INTO `Command` (`pk`, `commandUsage`, `commandType`, `verificationCommand`, `command`, `outputLocation`, `eventDetailCommand`, `description`, `supportedBy`, `outputFileFormat`, `replaces`, `lastModified`, `enabled`) VALUES ('ab17d28b-3f9a-45e2-b6da-fb19cf759c13','command','a5fa09c6-9a8d-40b9-aee2-2641160f969e','a9111dc0-edc9-47f8-85e5-ad4013971361','outputExtension=\"odt\"\nddirname=\"`dirname \"%fileFullName%\"`\"\ndbasename=\"`basename \"%fileFullName%\"`\" \ncd \"$ddirname\"\noutputFile=\"%outputDirectory%%prefix%%fileName%%postfix%.${outputExtension}\"\n\nflock -x /var/lock/documentConversion.lock -c \"soffice --nodefault --nologo --headless --convert-to $outputExtension \\\"${dbasename}\\\"\"\necho The exit code was $?\nset -e\n\necho mv \"%fileDirectory%%fileName%.${outputExtension}\" \"$outputFile\"\nmv \"%fileDirectory%%fileName%.${outputExtension}\" \"$outputFile\"\n','%outputDirectory%%prefix%%fileName%%postfix%.odt','0889b85d-e891-4d18-8e89-33b02783ba7a','Transcoding to ODT with openOffice','ca278b07-8137-4a75-b84f-9b10994ed006','OpenDocument Text',NULL,'2012-10-02 03:24:59',1);
INSERT INTO `Command` (`pk`, `commandUsage`, `commandType`, `verificationCommand`, `command`, `outputLocation`, `eventDetailCommand`, `description`, `supportedBy`, `outputFileFormat`, `replaces`, `lastModified`, `enabled`) VALUES ('b3b3b726-acef-4d58-82e4-ef8875d654ce','command','f3f2dae8-54ed-40b4-8f20-cffb249262cf',NULL,'echo Not including \"%inputFile%\" in DIP.','%inputFile%',NULL,'Don\'t include in DIP.','ca278b07-8137-4a75-b84f-9b10994ed006','',NULL,'2012-10-02 03:24:59',1);
INSERT INTO `Command` (`pk`, `commandUsage`, `commandType`, `verificationCommand`, `command`, `outputLocation`, `eventDetailCommand`, `description`, `supportedBy`, `outputFileFormat`, `replaces`, `lastModified`, `enabled`) VALUES ('b812bf73-7f58-4fa8-84d3-415e2f56daa8','verification','ee6869f7-3ac0-44ed-a5ca-50f0f81cd7c1',NULL,'#!/usr/bin/python\n#\n\nimport os\ndirectory = \"%outputLocation%\"\nextension = \".mboxi\"\n\ndef appendExtensionToFilesWithNoExtension(directory, extension, baseDirectory=\"\"):\n for dirname, dirnames, filenames in os.walk(directory):\n for filename in filenames:\n if filename.rfind(\".\") == -1:\n newName = filename + extension\n n=1\n while os.path.exists(os.path.join(dirname, newName)):\n newName = newName = filename + n.__str__() + extension\n n+=1\n print \"Renaming: \", filename, \" -> \" + newName\n os.rename(os.path.join(dirname, filename), os.path.join(dirname, newName))\n\nappendExtensionToFilesWithNoExtension(directory, extension, baseDirectory=directory)\n','',NULL,'append .mboxi extension to files without extensions','ca278b07-8137-4a75-b84f-9b10994ed006','',NULL,'2012-10-02 03:24:59',1);
INSERT INTO `Command` (`pk`, `commandUsage`, `commandType`, `verificationCommand`, `command`, `outputLocation`, `eventDetailCommand`, `description`, `supportedBy`, `outputFileFormat`, `replaces`, `lastModified`, `enabled`) VALUES ('bb5a6da2-4b89-4f8c-96e3-ca36c55d3337','command','a5fa09c6-9a8d-40b9-aee2-2641160f969e','a9111dc0-edc9-47f8-85e5-ad4013971361','ffmpeg -i \"%fileFullName%\" -vcodec libx264 -pix_fmt yuv420p -preset medium -crf 18 \"%outputDirectory%%prefix%%fileName%%postfix%.mp4\"','%outputDirectory%%prefix%%fileName%%postfix%.mp4','77f73d63-7d82-4b61-8dec-6626c3dc224a','Transcoding to mp4 with ffmpeg','ca278b07-8137-4a75-b84f-9b10994ed006','MPEG-4 Media File',NULL,'2012-12-19 01:54:26',1);
INSERT INTO `Command` (`pk`, `commandUsage`, `commandType`, `verificationCommand`, `command`, `outputLocation`, `eventDetailCommand`, `description`, `supportedBy`, `outputFileFormat`, `replaces`, `lastModified`, `enabled`) VALUES ('c072c3c8-ba0e-480b-b0ee-2f27c6c0653e','eventDetail','a5fa09c6-9a8d-40b9-aee2-2641160f969e',NULL,'echo program=\\\"unrar-nonfree\\\"\\; version=\\\"`unrar-nonfree | grep \'UNRAR\'`\\\"','',NULL,'Get event detail text for unrar extraction','ca278b07-8137-4a75-b84f-9b10994ed006','',NULL,'2012-10-02 03:24:59',1);
